Reposted @hbcuheroes When a legend speaks, we listen‼️ Major s/o to our friend & tour mentor @unclevinrock for droppin’ gems to a captivated crowd of #HBCU Gen Zers at our recent @hbcuheroes @securethebagtour stop at the illustrious campus of #ElizabethCityStateUniversity.

Our guy @cdkonthemic hosted this epic fireside chat asking all the burning questions that our future entrepreneurs, music producers & young professionals wanted to know to secure their own career bags. In true #VinRock fashion, his delivery was exceptional, his tips were epic & his insight was visionary. 

 In salute of #HipHop50 & entrepreneurship, we also loved hearing about the rise of @naughtybynature4ever and how @queenlatifah gave them their big break.  But don’t take our word for it…listen to these gems for yourself from Vin. 

👉👉Drop a ✊🏽in the comments to salute Vin Rock for doing his part to pour into #HBCUers across the tour with us. We can’t thank him enough. 🔥🙌✅💪🏾

